Drop table if exists rg_mp_em;
Drop table if exists rg_mp_eps;
Drop table if exists rg_mp_PtCiudad;
create table if not exists rg_mp_PtCiudad(
`PtCiudadId` int primary key auto_increment,
`Nombre` varchar(50),
`Departamento` varchar(50),
`Lat` varchar(50),
`Lng` varchar(50),
`Estado` enum('Inactivo', 'Activo') default 'Activo',
`CreatedBy` varchar(20) DEFAULT '',
`CreatedAt` timestamp DEFAULT current_timestamp,
`ModifiedBy` varchar(20) DEFAULT '',
`ModifiedAt` datetime,
INDEX(`PtCiudadId`));

create table if not exists rg_mp_eps(
`EpsId` int primary key auto_increment,
`Nombre` varchar(50),
`Codigo` varchar(10),
`Estado` enum('Inactivo', 'Activo') default 'Activo',
`CreatedBy` varchar(20) DEFAULT '',
`CreatedAt` timestamp DEFAULT current_timestamp,
`ModifiedBy` varchar(20) DEFAULT '',
`ModifiedAt` datetime,
INDEX(`EpsId`));

create table if not exists rg_mp_em(
`EmId` int primary key auto_increment,
`Eps` varchar(50),
`Codigo` varchar(10),
`Municipio` varchar(50),
`EpsId` int,
`MunicipioId` int,
`Valor` int,
`Tipo` enum('Subsidiado', 'Contributivo') default 'Subsidiado',
`Estado` enum('Inactivo', 'Activo') default 'Activo',
`CreatedBy` varchar(20) DEFAULT '',
`CreatedAt` timestamp DEFAULT current_timestamp,
`ModifiedBy` varchar(20) DEFAULT '',
`ModifiedAt` datetime,
INDEX(`EmId`, `EpsId`, `MunicipioId`));


ALTER TABLE `polivalente`.`rg_mp_ptciudad` 
ADD COLUMN `Orden` INT NULL AFTER `Lng`;


